import React from 'react';
import './Footer.css';
import { RiFacebookFill } from "react-icons/ri";

const Footer = () => {
  return (
    <footer className="footer">
      <a href="https://www.facebook.com/share/1Em2EsAHAR/" target="_blank" rel="noopener noreferrer">
        <RiFacebookFill size={30} color="#edf1f7" />
      </a>
    </footer>
  );
};

export default Footer;
